import React from "react";
import { useRouter } from "next/router";
import MainLayout from "../../layouts/main";

function Category() {
  const router = useRouter();
  const { cid } = router.query;

  return (
    <MainLayout>
      <p>I'm category: {cid}</p>
    </MainLayout>
  );
}

export default Category;
